import React, {useState} from 'react'
// import useProductsGet from '../hooks/useProductsGet';
import TableHeader from './TableHeader/TableHeader.js';
import OrderTable from './OrderTable/OrderTable.js'
// import TotalCosts from './TotalCosts/TotalCosts.js'
import TotalCosts from '../TotalCosts/TotalCosts.js'
// import './App.css';

function Table({isLoading}) {
  // const [{data, setData, isLoading}] = useProductsGet()
  const [cost, setCost] = useState(0)

  return (
    <>
        {!isLoading && (
            <table>
                <TableHeader/>
                <OrderTable setCost={setCost}/>
                <TotalCosts cost={cost}/>
            </table>
        )}
    </>
  );
}

export default Table;
